home_heading:'RAMENTOL & FLOREJACHS PROCURADORES',home_subHeading:'Con más de 30 años de experiencia ofreciendo sus servicios dentro del mundo de la Procuraduría.',home_subTitleTxt:'Ejercemos en Barcelona, Badalona, Santa Coloma de Gramenet, Hospìtalet de Llobregat, Granollers, Gavà y Lleida.',home_readMoreTxt:'Licenciados en Derecho',//Home_section1
home_s1_heading:'PRESENTACIÓN',home_s1_p1:'RAMENTOL&FLOREJACHS es un despacho de Procuradores fundado hace más de 30 años con amplia experiencia y extenso conocimiento del funcionamiento de los Juzgados y Tribunales de Barcelona y provincia.',home_s1_p2:'Como Procuradores, nos encargamos de llevar a cabo la representación judicial de nuestros clientes ante los Juzgados y Tribunales donde ejercemos nuestra profesión.',home_s1_p3:'Somos el enlace directo entre el Juzgado y el abogado, nuestro máximo interés es gestionar los expedientes judiciales con la mayor seriedad y celeridad, para ello, nos hemos centrado en la figura del Procurador de proximidad y así poder dar un servicio más  directo e inmediato, garantizando a nuestros clientes  que la tramitación de su procedimiento judicial avanza con la mayor presteza posible.',home_s1_p4:'Ofrecemos total seguridad a través de nuestras plataformas tecnológicas y procedimientos de calidad, proporcionando los niveles de fiabilidad más exigentes en la gestión de sus expedientes así como información continua sobre el estado de los mismos.',home_s1_icon:'Juzgado',//Home_team
home_teamTitle01:'ALBERT RAMENTOL NORIA',home_teamTxt01:'Licenciado en Derecho por la Universidad de Barcelona, atesora más de 30 años de ejercicio profesional como Procurador de los Tribunales. Colegiado número XXX del Ilustre Colegio de Procuradores de Barcelona, le avala su dilatada trayectoria  y aporta al despacho rigor, seriedad, minuciosidad en los detalles y extensa experiencia.',home_teamTitle02:'MARTA VIDAL FLOREJACHS',home_teamTxt02:'Licenciada en Derecho por la Universidad de Barcelona, siguió formándose realizando un postgrado en Nulidad, Separación y Divorcio en la misma Universidad. Desde el año 2012 ejerce de Procuradora de los Tribunales con número de colegiada 929 del Ilustre Colegio de Procuradores de Barcelona. Aporta al despacho la energía, la pericia, la diligencia  y la fiabilidad necesaria para ejercer la profesión con la máxima rigurosidad.',home_teamTitle03:'CRISTINA RAMENTOL SABATÉ',home_teamTxt03:'Licenciada en Derecho por la Universidad Oberta de Catalunya, ejerce de Procurador desde el año 2019. Anteriormente trabajo de Oficial Habilitada durante más de 15 años. Es un apoyo fundamental dentro del equipo, su interés por las nuevas tecnologías unido al apoyo constante que realiza en los Juzgados hace que el trabajo del despacho sea de total compromiso y mejor calidad.',//Partidos
